import React from 'react';
import { MDBRangeInput } from "mdbreact";



import './App.css';


const SliderPage = () => {

    return (
      <div className="my-5">
        <MDBRangeInput min={0} max={10} value={5} />
      </div>
    );
}


export default function App (){

    return (
    <div className="App">
      <header>
        <form>
        <li key="barName">
        <label>
          <h2>What is the Barname: </h2><br/>
          <input type = "text" id="barName"/>
        </label>
        </li>
        <li key="craft">
          <h2>Draught or Craft Beer </h2>
          {SliderPage}
        </li>
        <li key="wineList">

        </li>
        </form>
       </header>
    </div>
  );
}
